INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (0, -363.0, 7001, 0.0, 1, 106001, 7, 0.0, "2030/12/17 14:59:59", 1, "2015/12/17 15:00:00", "たまには\n協力するのもいいんじゃない？\nあたしも手を貸してあげる", 1, 0, "キャル");
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (0, -363.0, 7002, 0.0, 1, 105901, 7, 0.0, "2030/12/17 14:59:59", 1, "2015/12/17 15:00:00", "多くの方と協力して\n戦えるようです\n主さまなら、さぞ\nご活躍なさることでしょう", 1, 0, "コッコロ");
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (0, -363.0, 7003, 0.0, 1, 105801, 7, 0.0, "2030/12/17 14:59:59", 1, "2015/12/17 15:00:00", "たくさんの人と一緒に\n協力バトルです！\nがんばりましょう☆", 1, 0, "ペコリーヌ");
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (0, -363.0, 10001, 0.0, 1, 106001, 10, 0.0, "2030/12/17 14:59:59", 1, "2015/12/17 15:00:00", "ジュエルはよく考えて\n使うことね\n無駄遣い厳禁！", 1, 0, "キャル");
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (0, -363.0, 10002, 0.0, 1, 105901, 10, 0.0, "2030/12/17 14:59:59", 1, "2015/12/17 15:00:00", "主さまのジュエルで\n貴重な品々を購入できます\nですが、無駄遣いは\n『めっ』でございますよ", 1, 0, "コッコロ");
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (0, -363.0, 10003, 0.0, 1, 105801, 10, 0.0, "2030/12/17 14:59:59", 1, "2015/12/17 15:00:00", "ジュエルを食べ物…\nいえ、貴重品と交換できます！", 1, 0, "ペコリーヌ");
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (0, -416.5, 12001, 0.0, 1, 105801, 12, 0.0, "2030/12/17 14:59:59", 1, "2015/12/17 15:00:00", "特定の条件を達成すると\n報酬がもらえますよ！\nがんばりましょう♪　", 1, 0, "ペコリーヌ");
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (0, -363.0, 13001, 0.0, 1, 106001, 13, 0.0, "2030/12/17 14:59:59", 1, "2015/12/17 15:00:00", "思い出が詰まってるって\nいろいろあったけど\n振り返るのもいいんじゃない？", 1, 0, "キャル");
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (0, -363.0, 13002, 0.0, 1, 105901, 13, 0.0, "2030/12/17 14:59:59", 1, "2015/12/17 15:00:00", "主さまとの楽しい日々…\nこちらで何度でも\n思い返しましょう♪", 1, 0, "コッコロ");
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (0, -363.0, 13003, 0.0, 1, 105801, 13, 0.0, "2030/12/17 14:59:59", 1, "2015/12/17 15:00:00", "女の子との思い出が\nたくさん見られますよ！\nヒューヒュー♪\nモテモテですねー☆", 1, 0, "ペコリーヌ");
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (0, -363.0, 14001, 0.0, 1, 106001, 14, 0.0, "2030/12/17 14:59:59", 1, "2015/12/17 15:00:00", "クエストを攻略すると、\nアイテムが手に入るんだって\nもらえるものは、\nもらっておきましょ！", 1, 0, "キャル");
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (0, -363.0, 14002, 0.0, 1, 105901, 14, 0.0, "2030/12/17 14:59:59", 1, "2015/12/17 15:00:00", "育成に必要なアイテムが\n獲得できるクエストです\nわたくし、主さまのために、\n強くなりますよ", 1, 0, "コッコロ");
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (0, -363.0, 14003, 0.0, 1, 105801, 14, 0.0, "2030/12/17 14:59:59", 1, "2015/12/17 15:00:00", "このクエストを攻略すれば、\nアイテムがもらえますよ\nたくさん集めて、どんどん\n強くなっちゃいましょう！", 1, 0, "ペコリーヌ");
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (0, -470.0, 15001, 0.0, 1, 105901, 15, 0.0, "2030/12/17 14:59:59", 1, "2015/12/17 15:00:00", "主さま、旅の準備を整えて\nより充実した冒険をいたし\nましょう", 1, 0, "コッコロ");
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (0, -363.0, 16001, 0.0, 1, 106001, 16, 0.0, "2030/12/17 14:59:59", 1, "2015/12/17 15:00:00", "クランに入れるらしいわよ\nせっかくだから入ってみたら？\nけっこう楽しいみたいよ♪", 1, 0, "キャル");
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (0, -363.0, 16002, 0.0, 1, 105901, 16, 0.0, "2030/12/17 14:59:59", 1, "2015/12/17 15:00:00", "こちらでクランに加入できます\n素敵なクランがたくさんあって、\n目移りしてしまいますね", 1, 0, "コッコロ");
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (0, -363.0, 16003, 0.0, 1, 105801, 16, 0.0, "2030/12/17 14:59:59", 1, "2015/12/17 15:00:00", "クランに加入してみませんか？\nみんなといっしょに冒険した方が、\n楽しいですよ！", 1, 0, "ペコリーヌ");
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (0, -363.0, 17002, 0.0, 1, 105901, 17, 0.0, "2030/12/17 14:59:59", 1, "2015/12/17 15:00:00", " こちらではクランバトルに\n 参加された仲間のみなさんの\n 活躍を振り返ることができます", 1, 0, "コッコロ");
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (0, -363.0, 17004, 0.0, 1, 106001, 25, 0.0, "2030/12/17 14:59:59", 1, "2015/12/17 15:00:00", "模擬戦の戦績もアンタが\n気に入ったものがあれば\n記録しておけるのね", 1, 0, "キャル");
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (0, -363.0, 17005, 0.0, 1, 105901, 25, 0.0, "2030/12/17 14:59:59", 1, "2015/12/17 15:00:00", "主さま、今回のクランバトルでの\nご活躍が記録されています\nバトルの参考にいたしましょう", 1, 0, "コッコロ");
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (0, -363.0, 17006, 0.0, 1, 105801, 25, 0.0, "2030/12/17 14:59:59", 1, "2015/12/17 15:00:00", "今回のクランバトルでの戦績を\nおさらいできますよ！\n私にも見せてください☆", 1, 0, "ペコリーヌ");
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (0, -363.0, 18001, 0.0, 1, 190801, 18, 0.0, "2030/12/17 14:59:59", 1, "2015/12/17 15:00:00", "ようこそ！\nこちらでは、\nギルドハウスで流れる音楽の\n変更や購入が出来ますよ", 1, 0, "カリン");
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (0, -363.0, 18002, 0.0, 1, 190801, 18, 0.0, "2030/12/17 14:59:59", 1, "2015/12/17 15:00:00", "ＢＧＭの変更や購入は、こちらから\nできますよ\n素敵な音楽を、たくさんご用意\nいたしました！", 2, 0, "カリン");
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (0, -470.0, 19001, 0.0, 1, 190801, 19, 0.0, "2030/12/17 14:59:59", 1, "2015/12/17 15:00:00", "ギルドハウスの\nＢＧＭを変更できますよ\nあなたの好きな曲、\n私にも聴かせてくださいね", 3, 0, "カリン");
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (0, -470.0, 19002, 0.0, 1, 190801, 19, 0.0, "2030/12/17 14:59:59", 1, "2015/12/17 15:00:00", "こちらでは、ＢＧＭの変更が\nできますよ\nどんな曲に変更しますか？\nふふふ、私も楽しみです♪", 4, 0, "カリン");
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (0, -470.0, 20001, 0.0, 1, 190801, 20, 0.0, "2030/12/17 14:59:59", 1, "2015/12/17 15:00:00", "こちらでは、ＢＧＭを購入\nすることができますよ\n試聴することもできるので、\nじっくり選んでくださいね", 5, 0, "カリン");
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (0, -470.0, 20002, 0.0, 1, 190801, 20, 0.0, "2030/12/17 14:59:59", 1, "2015/12/17 15:00:00", "いらっしゃいませ！\nＢＧＭの購入はこちらです\n素敵な曲がたくさんあって、\n目移りしちゃいますね", 6, 0, "カリン");
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (0, -363.0, 21001, 0.0, 1, 106001, 21, 0.0, "2030/12/17 14:59:59", 1, "2015/12/17 15:00:00", "ここで手に入れたアイテムで\n専用装備を作成できるみたいね\nアイテムが集まったら\nさっそく作ってみましょ！", 1, 0, "キャル");
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (0, -363.0, 21002, 0.0, 1, 105901, 21, 0.0, "2030/12/17 14:59:59", 1, "2015/12/17 15:00:00", "攻略すると珍しいアイテムが\n手に入りますよ\nこのアイテムで専用装備を\n作成できるようです", 1, 0, "コッコロ");
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (0, -363.0, 21003, 0.0, 1, 105801, 21, 0.0, "2030/12/17 14:59:59", 1, "2015/12/17 15:00:00", "専用装備の作成に必要な\nアイテムを獲得できますよ\nたくさん集めてどんどん\n強くなりましょう！", 1, 0, "ペコリーヌ");
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (0, -430.0, 22001, 0.0, 1, 190801, 22, 0.0, "2030/12/17 14:59:59", 1, "2015/12/17 15:00:00", "投票はこちらです\nあなたが応援したい女の子に\n思いを込めた一票を\nお願いします！", 1, 0, "カリン");
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (0, -430.0, 22002, 0.0, 1, 190801, 22, 0.0, "2030/12/17 14:59:59", 1, "2015/12/17 15:00:00", "ようこそ！\nあなたが思いを寄せるのは\nどの女の子ですか？\n応援してあげてくださいね！", 2, 0, "カリン");
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (0, -430.0, 23001, 0.0, 1, 190801, 23, 0.0, "2030/12/17 14:59:59", 1, "2015/12/17 15:00:00", "たくさんの投票、\nありがとうございました\n結果発表を楽しみに\n待っていてくださいね！", 3, 0, "カリン");
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (0, -430.0, 23002, 0.0, 1, 190801, 23, 0.0, "2030/12/17 14:59:59", 1, "2015/12/17 15:00:00", "ただ今、人気投票の\n集計中です\n結果が出るまでもう少しだけ\nお待ちくださいね", 4, 0, "カリン");
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (0, -385.0, 24001, 8.0, 1, 109001, 24, 4.08, "2030/12/17 14:59:59", 2, "2019/01/31 12:00:00", "あなた様が手伝ってくださった\nチョコレートケーキ\n美味しくないはずがありませんわ", 1, 10011, "エリコ（バレンタイン）");
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (0, -385.0, 24002, 8.0, 1, 109001, 24, 5.0, "2030/12/17 14:59:59", 2, "2019/01/31 12:00:00", "このような失敗、あなた様が\nするはずありません\nもう一度挑戦してみましょう", 2, 10011, "エリコ（バレンタイン）");
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (0, -385.0, 24003, 8.0, 1, 109001, 24, 10.11, "2030/12/17 14:59:59", 2, "2019/01/31 12:00:00", "あなた様のために\n作っているケーキを\nあなた様に手伝っていただく……\nことになるなんて……クスクス", 3, 10011, "エリコ（バレンタイン）");
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (0, -385.0, 24004, 8.0, 1, 109001, 24, 4.0, "2030/12/17 14:59:59", 2, "2019/01/31 12:00:00", "あまり気に病む必要はありませんわ\nこれからは私がたっぷりと\n時間をかけて教えて差し上げますから", 4, 10011, "エリコ（バレンタイン）");
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (0, -385.0, 24005, 8.0, 1, 109001, 24, 6.0, "2030/12/17 14:59:59", 2, "2019/01/31 12:00:00", "今回は調子が悪かった……のですか？\nあなた様が手伝ってくれたものなら\nわたしはどんなものでも……クスクス", 5, 10011, "エリコ（バレンタイン）");
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (0, 0.0, 24006, 0.0, 1, 109002, 24, 0.0, "2030/12/17 14:59:59", 1, "2019/01/31 12:00:00", "あなた様が手がけた\nチョコレートケーキは\n私にとっての宝物……\n侮辱する者は生かしておきませんわ", 6, 10011, "エリコ（バレンタイン）");
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (0, 0.0, 24007, 0.0, 1, 109002, 24, 0.0, "2030/12/17 14:59:59", 1, "2019/01/31 12:00:00", "とても素晴らしい出来栄えですわ！\nあなた様にふさわしい\nチョコレートケーキができました", 7, 10011, "エリコ（バレンタイン）");
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (0, 0.0, 24008, 0.0, 1, 109002, 24, 0.0, "2030/12/17 14:59:59", 1, "2019/01/31 12:00:00", "私を手伝ってくれたあなた様は\nすでに私の虜……\n甘い世界に誘って差し上げますわ", 8, 10011, "エリコ（バレンタイン）");
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (0, 0.0, 24009, 0.0, 1, 109002, 24, 0.0, "2030/12/17 14:59:59", 1, "2019/01/31 12:00:00", "あなた様の愛情\nしかと受け止めました\nこれが……私たちの初めての\n共同作業ですわね……クスクス", 9, 10011, "エリコ（バレンタイン）");
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (0, 0.0, 24010, 0.0, 1, 109002, 24, 0.0, "2030/12/17 14:59:59", 1, "2019/01/31 12:00:00", "これは世界一の\nチョコレートケーキですわ\nだって、あなた様が腕によりをかけて\n作ってくださったんですもの", 10, 10011, "エリコ（バレンタイン）");
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (0, -385.0, 24011, 8.0, 1, 109101, 24, 2.12, "2030/12/17 14:59:59", 2, "2019/01/31 12:00:00", "上手にできなくて残念だった？\nでも、弟くんの気持ちが嬉しいな\nいつだってお姉ちゃんは\nそばにいるからね♪", 1, 10011, "シズル（バレンタイン）");
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (0, -385.0, 24012, 8.0, 5, 109101, 24, 4.19, "2030/12/17 14:59:59", 2, "2019/01/31 12:00:00", "うーん、弟くんには珍しく\n緊張しちゃったのかな？\nもう一度チャレンジしてみる？", 2, 10011, "シズル（バレンタイン）");
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (0, -385.0, 24013, 8.0, 2, 109101, 24, 2.3, "2030/12/17 14:59:59", 4, "2019/01/31 12:00:00", "お姉ちゃんのお手伝い、\nよくできました！\nあー、\nまだつまみ食いしちゃダメだぞ！", 3, 10011, "シズル（バレンタイン）");
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (0, 0.0, 24014, 0.0, 1, 109102, 24, 0.0, "2030/12/17 14:59:59", 1, "2019/01/31 12:00:00", "見てみて！\nスポンジに綺麗な焼き目がついてるよ\nさっすが弟くんだね！", 4, 10011, "シズル（バレンタイン）");
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (0, -385.0, 24015, 8.0, 5, 109101, 24, 5.23, "2030/12/17 14:59:59", 2, "2019/01/31 12:00:00", "まぁまぁ、落ち込まないで\n見た目は……個性的だけど、\n味は絶対美味しいはずだから！", 5, 10011, "シズル（バレンタイン）");
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (0, 0.0, 24016, 0.0, 1, 109102, 24, 0.0, "2030/12/17 14:59:59", 1, "2019/01/31 12:00:00", "弟くんみたいな\n可愛いケーキができたよ！\n早く食べてみたいでしょ♪", 6, 10011, "シズル（バレンタイン）");
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (0, -385.0, 24017, 8.0, 1, 109101, 24, 5.01, "2030/12/17 14:59:59", 2, "2019/01/31 12:00:00", "あれれ？　弟くん、指に\nチョコレートがくっついてるよ？\nお姉ちゃんが舐めてあげるね、\nはぁむ！", 7, 10011, "シズル（バレンタイン）");
